\"]], \"315\" [:div [:p] nil nil [:p/markdown \"### md\\n\\nNotes of kind `:md` are rendering their values as markdown. More precisely, the value is printed, and the captured printed string is expected to be of Markdown format. If the value is sequential, then its elements are printed and concantenated as lines of one multi-line string, that is then treated as Markdown.\"]], \"304\" [:div [:p] [:div [:p/code {:code \"^kind/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}]] nil nil], \"391\" [:div [:p] nil nil [:p/markdown \"To put files under your local project directory, in a place that is accessible to notespace, please use the `notespace.api/file-target-path` function.\"]], \"295\" [:div [:p] nil nil [:p/markdown \"#### eval-and-realize-notes-from-line\\n\\nUse `notespace.api/eval-and-realize-notes-from-line` to evaluate and realize all notes starting from a certain line, and inform Notespace.\"]], \"369\" [:div [:p] [:div [:p/code {:code \"(-> [:big [:big 3]]\\n    (kind/override kind/hiccup))\", :bg-class \"bg-light\"}]] nil [:big [:big 3]]], \"346\" [:div [:p] nil nil [:p/markdown \"Regular markdown text can contain math expressions using TeX notation: $(ax ^2 + bx + c = 0 )$.\"]], \"282\" [:div [:p] nil nil [:p/markdown \"# Notespace v3 intro\\n\\n[Notespace](https://github.com/scicloj/notespace) is a library that turns any Clojure namespace into a 'notespace' -- a namespace with a [notebook](https://en.wikipedia.org/wiki/Notebook_interface) experience. A notespace evolves in an interactive process of exploration, involving a dialogue of your editor, your REPL, your browser and your mind.\\n\\nSo, `Notespace` with a capital `N` is the name of the tool, and `notespace` with a small `n` is the notion that we just presented.\\n\\nHere we describe an experimental incomplete draft of Notespace Version 3.\\n\\nIt is still a bit buggy around handling concurrency, updating efficiently and connecting to the browser. But the current version shoul v [:p] nil nil [:p/markdown \"### void\\n\\nA `:void` note does not render its value.\"]], \"356\" [:div [:p] [:div [:p/code {:code \"^kind/dataset-grid\\n{:a [1 2 3]\\n :b [4 5 6]}\", :bg-class \"bg-light\"}]] nil [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"a\", :field \"a\"} {:headerName \"b\", :field \"b\"}], :rowData ({\"a\" 1, \"b\" 4} {\"a\" 2, \"b\" 5} {\"a\" 3, \"b\" 6})}]]], \"341\" [:div [:p] [:div [:p/code {:code \"^kind/hiccup\\n[:p/code \\\"def abcd(x):\\n  return x+9\\\"\\n {:language :python}]\", :bg-class \"bg-light\"}]] nil [:p/code \"def abcd(x):\\n  return x+9\" {:language :python}]], \"357\" [:div [:p] nil nil [:p/markdown \"--------------------\"]], \"284\" [:div [:p] [:div [:p/code {:code \"(+ 1 2\\n   3 4\\n   5 6)\", :bg-class \"bg-light\"}]] nil [:p/code {:code \"21\\n\"}]], \"400\" [:div [:p] nil nil [:p/markdown \"When rendering to static HTML, the external files will be moved alongside it, so that the same links work.\"]], \"363\" [:div [:p] nil nil [:p/markdown \"Notes which are forms like `(def ...)` or `(defn ...)` are assigned the kind `:void`.\"]], \"386\" [:div [:p] [:div [:p/code {:code \"(notespace/midje-summary)\", :bg-class \"bg-light\"}]] nil [:div [:div \"Tests summary:\" [:div [:big [:big {:style {:color \"darkgreen\"}} \"âœ“\"]] \": \" 1]]]], \"250\" [:div [:p] nil nil [:p/markdown \"An example of properly annotated form with a variable that resolves to a keyword which is attached to a kind->behavior method:\"]], \"289\" [:div [:p] [:div [:p/code {:code \"(def d1 (delay 11))\", :bg-class \"bg-light\"}]] nil nil], \"307\" [:div [:p] [:div [:p/code {:code \"^kind/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}]] nil [:big [:big 3]]], \"283\" [:div [:p] nil nil [:p/markdown \"## Notes\\n\\nHere is a note:\"]], \"312\" [:div [:p] [:div [:p/code {:code \"^kind/void\\n(+ 1 2)\", :bg-class \"bg-light\"}]] nil nil], \"337\" [:div [:p] [:div [:p/code {:code \"^kind/vega\\n{:description \\\"A simple bar chart with embedded data.\\\"\\n :data        {:values [{:a \\\"A\\\" :b 28} {:a \\\"B\\\" :b 55} {:a \\\"C\\\" :b 43}\\n                        {:a \\\"D\\\" :b 91} {:a \\\"E\\\" :b 81} {:a \\\"F\\\" :b 53}\\n                        {:a \\\"G\\\" :b 19} {:a \\\"H\\\" :b 87} {:a \\\"I\\\" :b 52}]}\\n :mark        :bar\\n :encoding    {:x {:field :a :type :nominal :axis {:labelAngle 0}}\\n               :y {:field :b :type :quantitative}}}\", :bg-class \"bg-light\"}]] nil [:p/vega {:description \"A simple bar chart with embedded data.\", :data {:values [{:a \"A\", :b 28} {:a \"B\", :b 55} {:a \"C\", :b 43} {:a \"D\", :b 91} {:a \"E\", :b 81} {:a \"F\", :b 53} {:a \"G\", :b 19} {:a \"H\", :b 87} {:a \"I\", :b 52}]}, :mark :bar, :encoding {:x {:field :a, :type :nominal, :axis {:labelAngle 0}}, :y {:field :b, :type :quantitative}}}]], \"347\" [:div [:p] nil nil [:p/markdown \"We can also include math tags in Hiccup elements:\"]], \"335\" [:div [:p] [:div [:p/code {:code \"^kind/quil\\n{:draw         '(fn [{:keys [circles]}]\\n                 (q/background 255)\\n                 (doseq [{[x y] :pos [r g b] :color} circles]\\n                   (q/fill r g b)\\n                   (q/ellipse x y 10 10)))\\n :update-state '(fn [{:keys [width height] :as state}]\\n                 (update state :circles conj {:pos   [(+ 20 (rand-int (- width 40)))\\n                                                      (+ 20 (rand-int (- height 40)))]\\n                                              :color (repeatedly 3 #(rand-int 250))}))\\n :init         '(fn [width height]\\n                 (fn []\\n                   {:width   width\\n                    :height  height\\n                    :circles []}))}\", :bg-class \"bg-light\"}]] nil [:p/quil {:draw (fn [{:keys [circles]}] (q/background 255) (doseq [{[x y] :pos, [r g b] :color} circles] (q/fill r g b) (q/ellipse x y 10 10))), :update-state (fn [{:keys [width height], :as state}] (update state :circles conj {:pos [(+ 20 (rand-int (- width 40))) (+ 20 (rand-int (- height 40)))], :color (repeatedly 3 (fn* [] (rand-int 250)))})), :init (fn [width height] (fn [] {:width width, :height height, :circles []}))}]], \"331\" [:div [:p] [:div [:p/code {:code \"^kind/sci\\n[:div [:big[:big '(+ 1 2)]]]\", :bg-class \"bg-light\"}]] nil [:p/sci [:div [:big [:big (+ 1 2)]]]]], \"352\" [:div [:p] nil nil [:p/markdown \"### dataset\\n\\nNotes of kind `:dataset` are expecting a dataset that prints nicely as a table in markdown (for exaple, a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries).\\n\\nIt wraps the resulting markdown with nice Bootstrap CSS classes, so that the table is displayed nicely.\\n\\nWe do not have an example here, since that would require depending on the above libraries.\"]], \"376\" [:div [:p] nil nil [:p/markdown \"## Extending Notespace with new note kinds.\"]], \"360\" [:div [:p] nil nil [:p/markdown \"### Plain html\"]], \"399\" [:div [:p] [:div [:p/code {:code \"(notespace/img-file-tag \\\"clojure.png\\\" {})\", :bg-class \"bg-light\"}]] nil [:img {:src \"notespace-files/clojure.png\"}]], \"293\" [:div [:p] nil nil [:p/markdown \"### More API functions\\n\\nNotespace offers some more API functions that allow for a dynamic experience with Clojure references.\"]], \"154\" [:div [:p] nil nil [:p/markdown \"#### eval-and-realize-this-notespace\\n\\nUse `notespace.api/eval-and-realize-this-notespace` to evaluate all notes in the current namespace sequentially, one note after another, and then realize them in the background. As always, Notespace is informed about the results.\"]], \"257\" [:div [:p] [:div [:p/code {:code \"(notespace/clojure-tests-summary)\", :bg-class \"bg-light\"}]] nil [:div [:div \"Tests summary:\" [:div [:big [:big {:style {:color \"darkgreen\"}} \"âœ“\"]] \": \" 1]]]], \"308\" [:div [:p] nil nil [:p/markdown \"Let us see what kinds of notes we have.\\n\\n### naive\\n\\nA `:naive` note renders its value by pretty-printing it.\"]], \"271\" [:div [:p] [:div [:p/code {:code \"(require '[clojure.java.io :as io])\", :bg-class \"bg-light\"}]] nil nil], \"174\" [:div [:p] [:div [:p/code {:code \"(require '[notespace.kinds :as k])\", :bg-class \"bg-light\"}]] nil nil], \"313\" [:div [:p] nil nil [:p/markdown \"### hidden\\n\\nA `:hidden` note does not render its value, and also does not show its code.\\n\\nHere is a note that you cannot see:\"]], \"320\" [:div [:p] nil nil [:p/markdown \"### hiccup\\n\\nA `:hiccup` note renders its value as Hiccup.\"]], \"325\" [:div [:p] [:div [:p/code {:code \"^kind/hiccup\\n[:div\\n [:h5 \\\"Plot:\\\"]\\n [:p/sparklinespot\\n  {:data      (->> #(- (rand) 0.5)\\n                   (repeatedly 99)\\n                   (reductions +))\\n   :svgHeight 20}]]\", :bg-class \"bg-light\"}]] nil [:div [:h5 \"Plot:\"] [:p/sparklinespot {:data (0.34337344159377914 0.4314709031673113 0.40292578460987316 0.7676572351013551 0.7148788803310786 0.3911183125472576 0.3656557083370543 0.1543374851820657 0.6257311953837046 0.14702171473070302 -0.09073872190128374 -0.08309544343848119 0.06841319156125714 0.43107772872146066 0.17656662737416273 -0.1726934673778513 0.2866176253319199 -0.04933402059771497 0.42445904825906955 -0.03934345682266338 0.45361314967941846 0.0694449546984266 0.11843107849763712 -0.1389221493173478 -0.20180954258349137 0.040065134611333986 -0.36355169935087084 -0.6899182389211875 -0.7702628548525148 -0.8357695574748997 -0.8940804800604412 -0.4367958948948393 -0.37651421047314293 -0.7139985598836873 -1.0375972643301608 -0.9326110992781558 -0.7450744677552003 -0.6349565368723029 -0.9011387931954796 -1.3558996020569118 -1.5381313003142765 -1.7081613897156345 -1.5844745656206387 -2.0526427805608036 -2.01795303736157 -1.9688969585404497 -2.467473691140211 -2.2567359864544936 -2.1499200244406653 -2.6066555283402546 -2.8833004132513045 -2.5513251618731836 -2.628110623746618 -2.3780869377886207 -2.416381748521511 -2.8040473911719865 -2.7053845669133048 -2.2560503381062746 -2.664706675960561 -2.7957394219529035 -2.3656189649918593 -2.1650154216364674 -2.3731910505413945 -1.9899674428208693 -2.0348092292101567 -2.0416093147871184 -2.330072789130042 -2.0273284083859155 -2.0578988898444592 -2.4575240441976343 -2.3128131186810483 -2.6898471858153084 -2.3204351641237593 -2.787284441744112 -3.1630055842584044 -3.0289820385325577 -3.4195690754703727 -3.2015311486832414 -3.1019220272553745 -2.86751978043836 -3.112470173803005 -3.1998041572754774 -3.301262713935057 -3.1096571952922964 -2.975050666095587 -3.3200050796360996 -3.648167020287391 -4.007263823608047 -4.007208402153096 -4.149878938206414 -4.445820420422228 -4.941514742718255 -5.4110585074749595 -5.603574502592345 -5.79806514623814 -5.324412666478863 -5.1237235913359624 -5.346457720382395 -5.3391130960190685), :svgHeight 20}]]], \"205\" [:div [:p] nil nil [:p/markdown \"The `vega` kind supports both Vega and Vega-Lite visualizations.\"]], \"306\" [:div [:p] nil nil [:p/markdown \"## Note kinds\\n\\nEach note has a kind, that determines its rendering behaviour.\\n\\nOne way to specify a note's kind is by metadata. For example, here is a note of kind `:hiccup`.\"]], \"287\" [:div [:p] nil nil [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]], \"316\" [:div [:p] [:div [:p/code {:code \"^kind/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}]] nil [:p/markdown \"##### text:\\n* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\"]], \"344\" [:div [:p] [:div [:p/code {:code \"^kind/code\\n(pr-str '(defn abcd [x] (+ x 9)))\", :bg-class \"bg-light\"}]] nil [:p/code \"(defn abcd [x] (+ x 9))\"]], \"398\" [:div [:p] [:div [:p/code {:code \"^kind/hiccup\\n[:button (notespace/file-link-tag \\\"download dummy.txt\\\" \\\"dummy.txt\\\")]\", :bg-class \"bg-light\"}]] nil [:button [:a {:href \"notespace-files/dummy.txt\"} \"download dummy.txt\"]]], \"324\" [:div [:p] nil nil [:p/markdown \"### extended hiccup\\n\\nIn fact, `:hiccup` and `:hiccup-nocode` render by an extended version of Hiccup, that supports [gorilla-ui](https://github.com/pink-gorilla/gorilla-ui) tags.\\n\\nHere are some examples.\"]], \"390\" [:div [:p] nil nil [:p/markdown \"## External files (experimental)\\n\\nSupport for external files is still considered experimental. The API will stabilize soon.\"]], \"377\" [:div [:p] [:div [:p/code {:code \"(defmethod\\n  ^{:doc\\n    \\\"Example of user extensible kind.\\nNote the ':reload true' in the :require vector:\\n[notespace.kinds :as k :reload true].\\nThis will make REPL testing your extensible kind easier!\\\"}\\n  kind/kind->behaviour ::just-code\\n  [_]\\n  {:render-src?   true\\n   :value->hiccup (constantly nil)})\", :bg-class \"bg-light\"}]] nil [:p/code {:code \"#multifn[kind->behaviour 0x5a860caa]\\n\"}]], \"353\" [:div [:p] nil nil [:p/markdown \"### dataset-grid\\n\\nNotes of kind `:dataset-grid` are expecting a value which is one of the following:\\n- a map, whose values are same-length sequentials (one example of such a map is a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries);\\n- a sequence of maps.\\n\\nThey render that values as an [ag-Grid](https://www.ag-grid.com/) table view.\\n\\nFor example:\"]], \"301\" [:div [:p] nil nil [:p/markdown \"### Atoms\"]], \"317\" [:div [:p] [:div [:p/code {:code \"^kind/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))))\", :bg-class \"bg-light\"}]] nil [:p/markdown \"##### numbers:\\n* 1\\n* 22\\n* 333\"]], \"340\" [:div [:p] [:div [:p/code {:code \"^kind/hiccup\\n[:p/code \\\"(defn abcd [x] (+ x 9))\\\"]\", :bg-class \"bg-light\"}]] nil [:p/code \"(defn abcd [x] (+ x 9))\"]], \"366\" [:div [:p] nil nil [:p/markdown \"## Interactive input and reactive notes\\n\\nComing soon.\"]], \"286\" [:div [:p] nil nil [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Notespace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]], \"342\" [:div [:p] nil nil [:p/markdown \"Such tags can usually be handled through dedicated kinds too.\"]], \"319\" [:div [:p] nil nil [:p/markdown \"* a\\n* b\\n* c\\n* d\"]], \"298\" [:div [:p] nil nil [:p/markdown \"### Futures\"]], \"322\" [:div [:p] nil nil [:p/markdown \"### hiccup-nocode\\n\\nNotes of kind `:hiccup-nocode` are rendered as Hiccup too, but without showing the code. Here is an example:\"]], \"367\" [:div [:p] [:div [:p/code {:code \"(comment\\n  (require '[notespace.cljfx.api :as fx]) \\n\\n  (notespace/update-config #(assoc % :evaluation-callback-fn\\n                             (fn [idx note-count note]\\n                               (let [expected-duration (or  (get-in note [:duration]) 0)]\\n                                 (println \\\"evaluate note: \\\" idx \\\"/\\\" (dec note-count)\\n                                          \\\", expected duration (s): \\\"\\n                                          (if (pos? expected-duration)\\n                                            expected-duration\\n                                            \\\"???\\\"))))))\\n\\n  (notespace/update-config #(assoc % :in-eval-count-down-fn\\n                           (fn [seconds]\\n                             (println seconds))))\\n  (reset! state/the-context\\n          (fx/swap-context @state/the-context\\n                           #(-> % (assoc-in [:config :render-src?] false)))))\", :bg-class \"bg-light\"}]] nil [:p/code {:code \"nil\\n\"}]], \"348\" [:div [:p] [:div [:p/code {:code \"^kind/hiccup\\n[:p/math\\n \\\"(ax ^2 + bx + c = 0 )\\\"]\", :bg-class \"bg-light\"}]] nil [:p/math \"(ax ^2 + bx + c = 0 )\"]], \"339\" [:div [:p] nil nil [:p/markdown \"Some additional tags such as `:p/code` are added by the [gorilla-notes](https://github.com/scicloj/gorilla-notes) infrastructure.\"]], \"288\" [:div [:p] nil nil [:p/markdown \"## References\\n\\nClojure references such as delays, futures, promises and atoms are handled by Notespace in a special way. Below we will see how Notespace offers ways to bring the dynamic REPL experience of such constructs to the dynamic browser view.\\n\\n### The rule of rendering\\n\\nAssume that a note's evaluation result `x` is a reference.\\n\\nIf `x` is already realized, then Notespace renders `@x` (dereferenced `x`) instead of `x`. In the rendering value, this is marked by `(dereferenced)`.\\n\\nOtherwise, you should see a mark that says it is still pending.\\n\\n\\nFor example:\"]], \"373\" [:div [:p] [:div [:p/code {:code \"(require '[notespace.behavior])\", :bg-class \"bg-light\"}]] nil nil], \"255\" [:div [:p] [:div [:p/code {:code \"(deftest t1\\n  (testing \\\"abcd\\\"\\n    (is (= 3 3))))\", :bg-class \"bg-light\"}]] nil [:div [:big [:big {:style {:color \"darkgreen\"}} \"âœ“\"]] \"   true\"]], \"236\" [:div [:p] nil nil [:p/markdown \"## Progress logging\\n\\nThis should be documented better soon.\"]], \"310\" [:div [:p] nil nil [:p/markdown \"This is the default kind, so usually there is no need to mention it.\"]], \"327\" [:div [:p] [:div [:p/code {:code \"(require '[gorilla-notes.components.leaflet.providers :as leaflet-providers])\", :bg-class \"bg-light\"}]] nil nil], \"333\" [:div [:p] nil nil [:p/markdown \"We can create [Quil](https://github.com/quil/quil) components. This is still work in progress.\"]], \"375\" [:div [:p] [:div [:p/code {:code \"(DummyType1. [:big [:big 3]])\", :bg-class \"bg-light\"}]] nil [:big [:big 3]]], \"170\" [:div [:p] nil nil [:p/markdown \"If you evaluated the code in the comment below once, then you should see `{:x 4}`. Otherwise, you should still see `{:x 3}`.\"]], \"285\" [:div [:p] nil nil [:p/markdown \"Notespace renders it so that we see both the code and the evaluation result.\\n\\nAll your namespace is seen as a sequence of toplevel forms, which are considered as notes, and rendered accordingly.\"]], \"378\" [:div [:p] [:div [:p/code {:code \"(def ^{:doc \\\"When making a user extensible kind, you MUST assign the keyword\\nto a variable. Annotating with a keyword WILL NOT WORK!\\\"} just-code ::just-code)\", :bg-class \"bg-light\"}]] nil nil], \"291\" [:div [:p] [:div [:p/code {:code \"d1\", :bg-class \"bg-light\"}]] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(delay - not running yet ...)\"]] nil], \"330\" [:div [:p] [:div [:p/code {:code \"^kind/hiccup\\n[:p/sci '(+ 1 2)]\", :bg-class \"bg-light\"}]] nil [:p/sci (+ 1 2)]], \"361\" [:div [:p] [:div [:p/code {:code \"^kind/html\\n(str \\\"<h4>h4</h4>\\\"\\n     \\\"<h5>h5</h5>\\\")\", :bg-class \"bg-light\"}]] nil [:p/html \"<h4>h4</h4><h5>h5</h5>\"]], \"349\" [:div [:p] nil nil [:p/markdown \"We can also have notes of math kind:\"]], \"323\" [:div [:p] nil nil [:big [:big 3]]], \"397\" [:div [:p] nil nil [:p/markdown \"Now we can include file links and images as follows:\"]], \"393\" [:div [:p] nil nil [:p/markdown \"Let us put some files there.\"]], \"351\" [:div [:p] [:div [:p/code {:code \"^kind/math\\n(str \\\"(ax ^2 \\\"\\n     \\\"+ bx \\\"\\n     \\\"+ c \\\"\\n     \\\" = 0)\\\")\", :bg-class \"bg-light\"}]] nil [:p/math \"(ax ^2 + bx + c  = 0)\"]], \"292\" [:div [:p] [:div [:p/code {:code \"d2\", :bg-class \"bg-light\"}]] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"12\\n\"}]], \"309\" [:div [:p] [:div [:p/code {:code \"^kind/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}]] nil [:p/code {:code \"((1 1 4 1 0 3)\\n (5 5 4 5 3 1)\\n (5 4 0 3 3 1)\\n (1 0 5 1 4 5)\\n (4 4 0 0 2 1)\\n (5 0 5 5 3 2))\\n\"}]], \"160\" [:div [:p] nil nil [:p/markdown \"If a note's value is a delay, then you can call `notespace.api/eval-and-realize-note-at-line` or `notespace.api/eval-and-realize-this-notespace` to realize it. Notespace will update its state with the dereferenced value.\\n\\nFor example:\"]], \"150\" [:div [:p] [:div [:p/code {:code \"(deref d2)\", :bg-class \"bg-light\"}]] nil [:p/code {:code \"12\\n\"}]], \"372\" [:div [:p] nil nil [:p/markdown \"## Inferring note behaviors from types\\nIt is possible to infer a note's behavior from the type of its rendered, overriding the behavior prescribed by its kind. This can be done by extending the `Behaving` protocol.\"]], \"371\" [:div [:p] [:div [:p/code {:code \"(-> {:description \\\"A simple bar chart with embedded data.\\\"\\n     :data        {:values [\\n                            {:a \\\"A\\\" :b 28} {:a \\\"B\\\" :b 55} {:a \\\"C\\\" :b 43}\\n                            {:a \\\"D\\\" :b 91} {:a \\\"E\\\" :b 81} {:a \\\"F\\\" :b 53}\\n                            {:a \\\"G\\\" :b 19} {:a \\\"H\\\" :b 87} {:a \\\"I\\\" :b 52}\\n                            ]}\\n     :mark        :bar\\n     :encoding    {:x {:field :a :type :nominal :axis {:labelAngle 0}}\\n                   :y {:field :b :type :quantitative}}}\\n    (kind/override kind/vega))\", :bg-class \"bg-light\"}]] nil [:p/vega {:description \"A simple bar chart with embedded data.\", :data {:values [{:a \"A\", :b 28} {:a \"B\", :b 55} {:a \"C\", :b 43} {:a \"D\", :b 91} {:a \"E\", :b 81} {:a \"F\", :b 53} {:a \"G\", :b 19} {:a \"H\", :b 87} {:a \"I\", :b 52}]}, :mark :bar, :encoding {:x {:field :a, :type :nominal, :axis {:labelAngle 0}}, :y {:field :b, :type :quantitative}}}]], \"314\" [:div [:p] nil nil nil]}}");
